Meteor Collection Find Documents Based on Latest Date Time in an Array<p><strong>How to get the latest documents from a collection using date time?</strong></p>
<p>I have searched in SO for this specific problem, but couldn't find an example that is similar to my data structure. I have this kind of data structure:</p>
<pre><code>[
   {
      stationId: 'xxxxx',
      stationName:  'xxxx',
      state: 'xxxx',
      lat: 'xxxxx',
      long: 'xx.xxxxx',
      waterLevel: [
         {
              wlDateTime: '11/04/2022 11:30',
              wlSeverity: 'Danger',
              wlLevel: 7.5
         },
         {
              wlDateTime: '11/04/2022 09:00',
              wlSeverity: 'Danger',
              wlLevel: 7.3
         },
         {
              wlDateTime: '11/04/2022 03:00',
              wlSeverity: 'Normal',
              wlLevel: 5.2
         }
      ],
      rainfallData: [
         {
              rfDateTime: '11/04/2022 11:30',
              rfSeverity: 'Heavy',
              rfLevel: 21
         },
         {
              rfDateTime: '11/04/2022 10:30',
              rfSeverity: 'Heavy',
              rfLevel: 21
         },
         {
              rfDateTime: '11/04/2022 9:30',
              rfSeverity: 'Heavy',
              rfLevel: 21
         }
      ]
   }
]
</code></pre>
<p>The question is, how can I get documents that have <code>wlDateTime</code> equal today, with <code>wlSeverity</code> equal to <code>Danger</code>, but I just want the latest record from the <code>waterLevel</code> array. The same case with the <code>rainfallData</code>array i.e. to return with the latest reading for today.</p>
<p>Sample expected return will be like this:</p>
<pre><code>[
   {
      stationId: 'xxxxx',
      stationName:  'xxxx',
      state: 'xxxx',
      lat: 'xxxxx',
      long: 'xx.xxxxx',
      waterLevelData: [
         {
              wlDateTime: '11/04/2022 11:30',  //latest data compared to the array
              wlSeverity: 'Danger',
              wlLevel: 7.5
         }
      ],
      rainfallData: [
         {
              rfDateTime: '11/04/2022 11:30', //latest data compared to the array
              rfSeverity: 'Heavy',
              rfLevel: 21
         }
      ]
   }
]
</code></pre>
<p>I've tried querying it like this:</p>
<pre><code>    Meteor.publish('Alerts', function(){
      return AlertLatest.find({
        'waterLevelData.wlSeverity':'Danger',
      }, {
        fields : {
        'stationName'               : 1,
        'state'                     : 1,
        'lat'                       : 1,
        'long'                      : 1,
        'waterLevelData.wlDateTime' : 1,
        'waterLevelData.wlSeverity' : 1,
        'waterLevelData.wlLevel'    : 1,
        'rainfallData.rfSeverity'   : 1,      
      }},{sort: { 'waterLevelData.wlDateTime' : -1}});
    })
</code></pre>
<p>but the query returned data that isn't how I wanted. Any help will be much appreciated.</p>
<h1><em><strong>UPDATE</strong></em></h1>
<p>I've tried the solution provided by @YuTing, which is using aggregate to customise the publication query. I went ahead and read a bit about Mongodb Aggregation, and found a Meteorjs community package (<a href="https://github.com/robfallows/tunguska-reactive-aggregate" rel="nofollow noreferrer">tunguska:reactive-aggregate</a>) which simplifies the process.</p>
<p>This is the sample of a working aggregation so far:</p>
<pre><code>Meteor.publish('PIBDataAlerts', function(){
      const start = dayjs().startOf('day'); // set to 12:00 am today
      const end = dayjs().endOf('day'); // set to 23:59 pm today
      ReactiveAggregate(this, PIBLatest, [
        {
          $match: {   
            'stationStatus' : 'ON',
            'waterLevelData': {        //trying to get only today's docs
                &quot;$elemMatch&quot; : {
                    &quot;wlDateTime&quot; : {
                        $gte: start.format()  , $lt: end.format()  
                    }
                }
            }
          }
        },
        {
          $set: {
            waterLevelHFZ: {
              $filter: {
                input: &quot;$waterLevelData&quot;,
                as: &quot;w&quot;,
                cond: {
                  $and: [
                    { $or : [
                      { $eq: [ &quot;$$w.wlSeverity&quot;, &quot;Alert&quot; ] },
                      { $eq: [ &quot;$$w.wlSeverity&quot;, &quot;Warning&quot; ] },
                      { $eq: [ &quot;$$w.wlSeverity&quot;, &quot;Danger&quot; ] },
                    ]},
                    { $eq: [ &quot;$$w.wlDateTime&quot;, { $max: &quot;$waterLevelData.wlDateTime&quot; } ] }
                  ],
                }
              }
            },
            rainfallDataHFZ: {
              $filter: {
                input: &quot;$rainfallData&quot;,
                as: &quot;r&quot;,
                cond: { $eq: [ &quot;$$r.rfDateTime&quot;, { $max: &quot;$rainfallData.rfDateTime&quot; } ] }
              }
            }
          }
        },
        {
          $project : {
            &quot;stationId&quot;: 1,
            &quot;stationName&quot; :1,
            &quot;state&quot;: 1,
            &quot;waterLevelHFZ&quot;: 1,
            &quot;rainfallDataHFZ&quot;: 1
          }
        }
      ]);
    })
</code></pre>
<p>I'm struggling to get documents that only have the <code>wlDateTime</code> that equals today. I've tried a query in the <code>$match</code> but it returned empty array. If the <code>$match</code> is set to <code>{}</code>, it'll return all 1548 records even though the <code>wlDateTime</code> is not equals to today.</p>

