How to convert an array of strings values to numeric values for Mongoose schema containing few numeric fields?<p>My problem is that, I have a MongoDB collection named 'sold', which contains some string fields and some numeric fields.</p>
<pre><code>    const soldSchema = new Schema(
  {
    sku: String,
    hsn: String,
    qty: Number,
    article: String,
    mrp: Number,
    disc: Number,
    taxrate: Number,
    tax: Number,
    total: Number,
    orderid: String,
  },
  { collection: &quot;sold&quot;, timestamps: true }
);
const Sold = mongoose.model(&quot;sold&quot;, soldSchema);
module.exports = { Customer, Stock, Sold, Order };
</code></pre>
<p>The 'Customer', 'Stock', and 'Order' are other schema are in the same module.</p>
<p>For the sold schema, I received the data from the front end, which is an array of objects like this as shown below:</p>
<pre><code>[
  {
    sku: '10005',
    hsn: '3652',
    qty: '3',
    article: 'tops',
    mrp: '550',
    disc: '0',
    taxrate: '5',
    tax: '82.50',
    total: '1732.50',
    orderid: '1633515982545'
  },
  {
    sku: '10005',
    hsn: '3652',
    qty: '3',
    article: 'tops',
    mrp: '550',
    disc: '0',
    taxrate: '5',
    tax: '82.50',
    total: '1732.50',
    orderid: '1633515982545'
  },
  {
    sku: '10005',
    hsn: '3652',
    qty: '3',
    article: 'tops',
    mrp: '550',
    disc: '0',
    taxrate: '5',
    tax: '82.50',
    total: '1732.50',
    orderid: '1633515982545'
  }
]
</code></pre>
<p>The above array is the result of req.body i.e. console.log(req.body)</p>
<p>If I change all the fields to type 'String' in soldSchema, then all the values get inserted in a single go.</p>
<p>This function works fine with all string values in the schema.</p>
<pre><code>async function insertManySold(req, res) {
  let items = req.body;
