Removing function on server which delete array with bunch IDs<p>I have an app that looks like this <a href="https://i.stack.imgur.com/f1b7k.png" rel="nofollow noreferrer">picture 1</a></p>
<p>I choose checkboxes and after I press mass delete and in state I have array of ids which I have chosen (<a href="https://i.stack.imgur.com/g87Zr.png" rel="nofollow noreferrer">picture 2</a>)
My delete function in controllers looks the following</p>
<pre><code>const deleteProduct = async (req, res) =&gt; {
  const { id: productId } = req.params;
  const product = await Product.findOne({ _id: productId });
  console.log(product);

  if (!product) {
    throw new Error(`No product with ${productId}`);
  }
  await product.remove();
  res.status(200).json({ msg: &quot;Success, product removed&quot; });
};
</code></pre>
<p>But this function works in postman only on route</p>
<pre><code>router.route(&quot;/:id&quot;).delete(deleteProduct)
</code></pre>
<p>How to write a function which takes the array of items and a route for that?</p>

