<p>And sink to <strong>mongodb</strong> by kafka connector</p>
<pre><code>{
    &quot;connector.class&quot;: &quot;MongoDbAtlasSink&quot;,
    &quot;name&quot;: &quot;confluent-mongodb-sink&quot;,
    &quot;input.data.format&quot; : &quot;JSON&quot;,
    &quot;connection.host&quot;: &quot;ip&quot;,
    &quot;topics&quot;: &quot;viewPageCountByUsers&quot;,
    &quot;max.num.retries&quot;: &quot;3&quot;,
    &quot;retries.defer.timeout&quot;: &quot;5000&quot;,
    &quot;max.batch.size&quot;: &quot;0&quot;,
    &quot;database&quot;: &quot;test&quot;,
    &quot;collection&quot;: &quot;ViewPagesCountByUsers&quot;,
    &quot;tasks.max&quot;: &quot;1&quot;
}
</code></pre>
<p>The problem is that this data is very frequent and very load mongodb. How i can set kafkaconnection that send only last value by key as batch, example with 5 sec delay ?
Example: It's pointless to update the database 5 times</p>
<pre><code>{countryID:7, viewCount: 111}
