Replace field with MongoDB aggregate. Why $set, $addFields and $project, doesn't always replace the field?<p>Passing an object to an existing field in <code>$set</code> or <code>$addFields</code> <em>merges</em> objects rather than replaces them, e.g.</p>
<p><a href="https://mongoplayground.net/p/aXe-rExjCXr" rel="nofollow noreferrer">https://mongoplayground.net/p/aXe-rExjCXr</a></p>
<pre class="lang-js prettyprint-override"><code>// Collection
[
  {
    &quot;_id&quot;: &quot;123&quot;,
    &quot;options&quot;: {
      &quot;size&quot;: &quot;Large&quot;,
      &quot;color&quot;: &quot;Red&quot;
    }
  }
]
</code></pre>
<pre class="lang-js prettyprint-override"><code>// Aggregate
db.collection.aggregate([
  {
    $set: {
      options: {
        size: &quot;Small&quot;
      }
    }
  }
]);
</code></pre>
<pre class="lang-js prettyprint-override"><code>// Expect
[
  {
    &quot;_id&quot;: &quot;123&quot;,
    &quot;options&quot;: {
      &quot;size&quot;: &quot;Small&quot;
    }
  }
]
</code></pre>
<pre class="lang-js prettyprint-override"><code>// Actual
[
  {
    &quot;_id&quot;: &quot;123&quot;,
    &quot;options&quot;: {
      &quot;size&quot;: &quot;Small&quot;,
      &quot;color&quot;: &quot;Red&quot; // &lt;-- Not expected?
    }
  }
]
</code></pre>
<p>(It get's even weirder with arrays)</p>
<p>Is it possible to have it behave like non-object values and simply replace the field?</p>
<p>For context, I want to use this in an <a href="https://www.mongodb.com/docs/manual/tutorial/update-documents-with-aggregation-pipeline/" rel="nofollow noreferrer">aggregate update pipeline</a>.</p>

